import React from 'react';
import './App.css';

BASE_URL = "http://localhost:3000/pups"

function App() {

  function renderDogs() {
    fetch(BASE_URL)
    .then(resp => resp.json())
    .then(dogs => console.log(dogs))
  }

  return (
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">
        {renderDogs()}
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  );
}

export default App;
